import React from 'react'

class AsideFinances extends React.Component{
    render(){
        return(
        <div className='asideFinances'>
        <h1>Add expenses</h1>
        <form onSubmit={this.props.formSubmit}>
            <input type='text' ref={this.props.expense} />
            <button value='submit' onClick={this.props.formSubmit}>submit</button>
        </form>
        </div>
        )
    }
}

export default AsideFinances
